#include "sinvalueconst.h"

const unsigned int sinvalueconst[];
/*--------------- D E F I N I T I O N ------------------------------*/

/*--------------- M A C R O S --------------------------------------*/

/*--------------- D E C L A R A T I O N ----------------------------*/

signed int sin_const(signed long Angle)
{
    signed int SinValue = 0;
    while(Angle > 36000)
    {
        Angle = Angle - 36000;
    }
    while(Angle < 0)
    {
        Angle = Angle + 36000;
    }
    if(Angle < 18000)
    {
        SinValue = sinvalueconst[Angle];
    }
    else if(Angle == 18000)
    {
      SinValue = 0;
    }
    else
    {
        SinValue = 36000 - Angle;
        SinValue = 0 - sinvalueconst[SinValue];
    }
    return SinValue;
}
/*******************高精度余弦*********************/
signed int cos_const(signed long Angle)
{
    signed int CosValue = 0;
    while(Angle > 36000)
    {
        Angle = Angle - 36000;
    }
    while(Angle < 0)
    {
        Angle = Angle + 36000;
    }
    if(Angle <= 9000)
    {
        CosValue = sinvalueconst[9000 - Angle];
    }
    else if(Angle <= 18000)
    {
        CosValue = Angle - 9000;
        CosValue = 0 - sinvalueconst[CosValue];
    }
    else if(Angle <= 27000)
    {
        CosValue = 27000 - Angle;
        CosValue = 0 - sinvalueconst[CosValue];
    }
    else
    {
        CosValue = sinvalueconst[Angle - 27000];
    }
    return CosValue;
}

signed int tan_const(signed long Angle)
{
    long TanValue;
    if(Angle > 6500) Angle = 6500;
    if(Angle == 0)
    {
        TanValue = 0;
    }
    else
    {
        TanValue = 10000L * sin_const(Angle) / cos_const(Angle);
    }
    return TanValue;
}
//arccos()函数
//输入（0,10000）
//输出（0,18000）
signed long arccos_const(signed int value)
{
    int vax,r;
    int down,up,mid;
  
    if(value < cos_const(17999))
    {
        return 17999;
    }
    else if(value > cos_const(1))
    {
        return 1;
    }
  
    vax = ABS(value);
    down = 0;
    mid = 9000;
    up = 17999;
  
    while(up >= down)
    {
         if(vax < cos_const(mid))
        {
            down = mid + 1;
        }
        else
        {
            up = mid - 1;
        }
        mid = (up + down)>>1;
    }
  
    r = (vax - cos_const(up)) / (cos_const(down) - cos_const(up)) + up;
    
    return r;
}

//arcsin()函数
//输入（0,10000）
//输出（-9000,9000）
signed long arcsin_const(signed int value)
{
    int vax,r;
    int down,up,mid;
  
    if(value < sin_const(-8999))
    {
        return -8999;
    }
    else if(value > sin_const(8999))
    {
        return 8999;
    }
  
    vax = ABS(value);
    down = -8999;
    mid = 0;
    up = 8999;
  
    while(up >= down)
    {
        if(vax > sin_const(mid))
        {
            down = mid + 1;
        }
        else
        {
            up = mid - 1;
        }
        mid = (up + down)>>1;
    }
  
    r = (vax - sin_const(up)) / (sin_const(down) - sin_const(up)) + up;
    
    if(value < 0)
    r = -r;
  
    return r;
}


